import { makeStyles } from "@material-ui/core";

const useStyles = makeStyles({
  lstNgayChieu: {
    paddingTop: 15,
  },
  ngayChieu: {
    fontSize: 16,
    marginBottom: 5,
    fontWeight: 500,
  },
  groupTime: {
    display: "flex",
    flexWrap: "wrap",
    gap: 10,
  },
});
export default useStyles;
